window.bookSummaryJSON = "<p>From the Amazon.com and Wall Street Journal #1 bestselling authors of the Zodiac Academy series Caroline Peckham &amp; Susanne Valenti.</p> <p>The dragons are lost.</p> <p>The elements are at war.</p> <p>And fate doesn't favour the wicked.</p> <p>Cover and blurb coming soon.</p> <p>***This is an enemies to lovers romantasy series set in the same world as Zodiac Academy, but it's a dark and villainous tale of its own. You haven't met tainted souls like these before or enemies that hate each other as deeply as these characters do. Book 1 in the series will leave your heart raw and bloody. You'll be left gasping for breath and aching for more of the dark and twisted Fae who lurk between the pages and they might just be irredeemable...***</p>"; 
